import React from "react";
import { Box,LinearProgress } from "@mui/material";



const Tryon = () => {

  return (

    <>
     <Box sx={{ width: "100vw" }}>
              <LinearProgress />
            </Box>
      <Box sx={{ mt: 4, height: "100vh", ml: 1, mr: 1 }}>
        <iframe
          src="https://dinahawiditesting.as.me/schedule.php"
          title="Schedule Appointment"
          width="100%"
          height="100%"
          frameBorder="0"
        ></iframe>
      </Box>
    </>
  );
};
export default Tryon;
